var dataTimes=[];
var dataPart=[];
var dataa;
    fetch('https://backend-111406.onrender.com/api/record/user4', {
        method: "GET",
        headers: new Headers({
            'Content-Type': 'application/json',
            'token': `eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTExOTY0fQ.PXDk2A4d3WztESEScxXiApslLhEOZIcC2UHybw3R-xU`, /* 把token放在這 */
        })
}
)

        .then(results=>results.json())
        .then(results=>{
        dataa=results.data;

    });

dataa.map((a)=>(
    dataTimes.push(a.times)
))
dataa.map((a)=>(
    dataPart.push(a.part)
))
var result = dataa.map(dataa, function(item, index) {
    return item.part;
  }).indexOf('biceps');
console.log(result);
export const data1234={
    labels:"beceps",
    datasets:[
        {
            label: "biceps",
            data: result,
            fill: true,
            backgroundColor: "rgba(75,192,192,0.2)",
            borderColor: "rgba(75,192,192,1)",
            lineTension: 0.5
        }
    ]
}
